import styles from './Button.module.scss';

interface CapsuleButtonProps {
  onClick?: () => void;
  isClickable?: boolean;
  classNames?: string;
  children: React.ReactNode;
}

const NavCapsuleButton = ({ onClick, isClickable, classNames, children }: CapsuleButtonProps) => {
  const buttonClassNames = `
    ${styles.capsuleButton}
    ${classNames}
    ${typeof isClickable === 'undefined' || isClickable ? styles.clickable : ''}
  `;
  return (
    <button className={buttonClassNames} onClick={onClick}>
      {children}
    </button>
  );
};

export default NavCapsuleButton;
